package com.hq.bean;import java.util.Date;public class Huxing implements java.io.Serializable {	private long id;	private long house_id;	private String path;	private String orgname;	private String mime;	private int level;	private String dis;	private String area;	private Date ctime;	private int price;	public long getId() {		return id;	}	public void setId(long id) {		this.id = id;	}	public long getHouse_id() {		return house_id;	}	public void setHouse_id(long house_id) {		this.house_id = house_id;	}	public String getPath() {		return path;	}	public void setPath(String path) {		this.path = path;	}	public String getOrgname() {		return orgname;	}	public void setOrgname(String orgname) {		this.orgname = orgname;	}	public String getMime() {		return mime;	}	public void setMime(String mime) {		this.mime = mime;	}	public int getLevel() {		return level;	}	public void setLevel(int level) {		this.level = level;	}	public String getDis() {		return dis;	}	public void setDis(String dis) {		this.dis = dis;	}	public String getArea() {		return area;	}	public void setArea(String area) {		this.area = area;	}	public Date getCtime() {		return ctime;	}	public void setCtime(Date ctime) {		this.ctime = ctime;	}	public int getPrice() {		return price;	}	public void setPrice(int price) {		this.price = price;	}}